import React from "react";
import logo from "../../sourse/images/img.png";
import icon1 from "./svg/img.png"
import icon2 from "./svg/img_1.png"
import icon3 from "./svg/img_2.png"
import style from "./Header.module.css"
import "https://unpkg.com/ionicons@7.1.0/dist/ionicons/ionicons.esm.js";
import "https://unpkg.com/ionicons@7.1.0/dist/ionicons/ionicons.js";
import { ERROR_ROUTE, HOME_ROUTE } from "../../utils/consts";
import { Link } from "react-router-dom";

const Header = (props) => {

    return (
            <header className={`${style.header}`}>
            <div className={`${style.header__logo}`}>
                <Link to={HOME_ROUTE}>
                    <img src={logo} alt="logotype"/>
                </Link>
                <span>InLife</span>
            </div>
            <nav className={style.header__navigation}>
                <Link to={ERROR_ROUTE}>Профориентация </Link>
                <Link to={ERROR_ROUTE}>Выбрать вакансию</Link>
                <Link to={ERROR_ROUTE}>Карьера в ГЭНДАЛЬФ</Link>
                <Link to={ERROR_ROUTE}>Стажерство</Link>
                <Link to={ERROR_ROUTE}>Стажерство</Link>
            </nav>
                <div className={style.right}>
                    <div className={style.header__logIn}>
                <nav className={style.icons}>
                    {/* <img src={icon1} alt="icon1" style={{width:'20px'}}/> */}
                    <img src={icon2} alt="icon2" style={{width:'30px'}}/>
                    <img src={icon3} alt="icon3" style={{width:'20px'}}/>
                </nav>
                <Link to={ERROR_ROUTE}>
                    <button className={style.btn1}>Запись на собеседование</button>
                </Link>
            </div>
                </div>

            </header>
        // </div>

    );
};

export default Header;
